import React from 'react';

const VerticalNavbar = () => {
    return (
        <div className="col-md-2">
            <div className="list-group">
                <a href="#" className="list-group-item">Link 1</a>
                <a href="#" className="list-group-item">Link 2</a>
                <a href="#" className="list-group-item">Link 3</a>
                {/* Add more vertical navbar links */}
            </div>
        </div>
    );
};

export default VerticalNavbar;
